import React, { useEffect, useState } from 'react'
import { getPosts } from '../../API/Axios';

export interface Post {
    post_id:number;
    goal_id:number;
    user_id:number;
    message_text:string;
    photo:Blob;

}

interface PostListProp{
    posts : Post[],
    setPosts : Function
}

function PostList(prop : PostListProp) {
  
    useEffect(() => {
        const getPostList = async () =>{
          const data = await getPosts();
          prop.setPosts(data);
      }}
    , [prop.posts])
    return (
      <div>
          <h3>Consumed Messages: </h3>
              <ul>
                  {prop.posts.map((post,index) => (
                      <li key = {index}>{post.user_id}</li>
                  ))}
              </ul>
      </div>
    )
  }
  
  export default PostList
